import React, { Component } from "react";
import Avatar from "@mui/material/Avatar";
import Stack from "@mui/material/Stack";
import Box from "@mui/material/Box";
import "./UserProfile.css";
import Button from "@mui/material/Button";
import { useTheme } from '@mui/material/styles';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import KeyboardBackspaceIcon from "@mui/icons-material/KeyboardBackspace";

const ITEM_HEIGHT = 48;
const ITEM_PADDING_TOP = 8;
const MenuProps = {
  PaperProps: {
    style: {
      maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
      width: 250,
    },
  },
};

const Appointments = [
  'Oliver Hansen',
  'Van Henry',
  'April Tucker',
  'Ralph Hubbard',
  'Omar Alexander',
  'Carlos Abbott',
  'Miriam Wagner',
  'Bradley Wilkerson',
  'Virginia Andrews',
  'Kelly Snyder',
];

function getStyles(name, personName, theme) {
  return {
    fontWeight:
      personName.indexOf(name) === -1
        ? theme.typography.fontWeightRegular
        : theme.typography.fontWeightMedium,
  };
}

class UserProfile extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: "Rishabh Gupta",
      age: "17",
      gender: "M",
      location: "Ghaziabad",
      height: "175",
      weight: "60",
      bloodType: "A+",
      bloodSugar: "100",
      bloodPressure: "130/80",
      countryCode: "+91",
      phoneNumber: "9889069688",
      email: "rishabhgupta4523@gmail.com",
      passportNumber: "1234567890",
      medicalConditions: "Cough, Cold",
    };
  }

  render() {
    const theme = useTheme();
    const [personName, setPersonName] = React.useState([]);
  
    const handleChange = (event) => {
      const {
        target: { value },
      } = event;
      setPersonName(
        // On autofill we get a stringified value.
        typeof value === 'string' ? value.split(',') : value,
      );
    };
    return (
      <div>
        <div className="navBarProfile">
          <div className="ButtonBack">
            <Button variant="contained" startIcon={<KeyboardBackspaceIcon/>} size="small" id="backButton">
              Back
            </Button>
            <span>Patient Profile</span>
          </div>
          <div className="Appointments">
            
          </div>
        </div>
        <div className="ProfileCard">
          <div className="UserProfileCard">
            <Stack direction="row" spacing={2} className="Card">
              <Avatar
                alt="this.state.name"
                src="https://imgtr.ee/images/2023/03/20/qIWnl.jpg"
                sx={{ width: 46, height: 46 }}
              />
              <input hidden accept="image/*" type="file" />
              <p>{this.state.name} </p>
            </Stack>
            <p className="age">{this.state.age} years old</p>
            <div className="bottom_Card">
              <span className="height">
                Height &nbsp; &nbsp;
                {this.state.height}
              </span>
              <span className="weight">
                Weight &nbsp; &nbsp;
                {this.state.weight}
              </span>
              <span className="bloodType">
                Blood Group &nbsp; &nbsp;
                {this.state.bloodType}
              </span>
            </div>
          </div>
          <div className="UserInfo">
            <Box className="BoxCardInfo"></Box>
          </div>
        </div>
      </div>
    );
  }
}

export default UserProfile;
